import CheckBoxFilterBlock from "./CheckBoxFilterBlock";
import "./Filters.css";

function Filters() {
  return (
    <div className="filtersContainer">
      Фильтры
      <CheckBoxFilterBlock name="Размеры"></CheckBoxFilterBlock>
    </div>
  );
}

const checkBoxFilterData = [
  { key: 0, text: "S" },
  { key: 1, text: "M" },
  { key: 2, text: "X" },
  { key: 3, text: "XS" },
];

export default Filters;
